import { FC } from 'react';
import { Scatter, ChartData } from 'react-chartjs-2';

const Index: FC<{}> = () => {
    const data: ChartData<Chart.ChartData> = {
        datasets: [
            {
                label: 'Hey',
                data: [
                    {
                        x: 10,
                        y: 5
                    }
                ],
                pointBackgroundColor: 'green',
                pointBorderColor: 'green'
            }
        ]
    };

    return <Scatter data={data} />
};

export default Index;
